import React from 'react';
import AdminNavbar from '../components/AdminNavbar';

const AdminHomePage = () => {
  return (
    <div>
      <AdminNavbar />
      <div className="content">
        <h1>Admin Home Page</h1>
        <p>Welcome to the admin dashboard. Here you can view and manage complaints, update their status, view analytics, and more.</p>
      </div>
    </div>
  );
};

export default AdminHomePage;
